import React from "react";

const Detail = (props) => {
  return (
    <div>
      <h2>단어 추가하기</h2>
      <form>
        <div>
          <label>단어</label>
          <input type="text"></input>
        </div>
      </form>
    </div>
  );
};

export default Detail;
